import React, { useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import { motion } from 'framer-motion';

// Custom styles for cyberpunk theme
const cyberpunkStyles = {
  textGradient: 'bg-clip-text text-transparent bg-gradient-to-r from-cyan-400 to-purple-500',
  borderGradient: 'border border-transparent border-gradient-to-r from-cyan-500/30 to-purple-500/30',
  cardHover: 'hover:shadow-[0_0_15px_rgba(34,211,238,0.3)] hover:border-cyan-400/50',
  glowText: 'text-shadow: 0 0 8px rgba(34, 211, 238, 0.7)',
  glowBox: 'shadow-[0_0_15px_rgba(34,211,238,0.3)]',
};

const ArtxticCaseStudy = () => {
  const navigate = useNavigate();

  // Smooth scroll to top on component mount
  useEffect(() => {
    window.scrollTo(0, 0);
  }, []);

  // Handle back to experience navigation
  const handleBackToExperience = () => {
    navigate('/#experience');
  };

  return (
    <div className="min-h-screen bg-gray-900 text-gray-100">
      {/* Back Button */}
      <div className="container mx-auto px-4 py-8">
        <button 
          onClick={handleBackToExperience}
          className="flex items-center text-cyan-400 hover:text-cyan-300 transition-colors mb-8 group"
        >
          <svg className="w-5 h-5 mr-2 transform group-hover:-translate-x-1 transition-transform" fill="none" stroke="currentColor" viewBox="0 0 24 24">
            <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M10 19l-7-7m0 0l7-7m-7 7h18" />
          </svg>
          Back to Experience
        </button>
      </div>

      {/* Hero Section */}
      <section className="relative py-20 overflow-hidden bg-gradient-to-br from-purple-900 via-gray-900 to-gray-900">
        <div className="container mx-auto px-4 text-center relative z-10">
          <motion.h1 
            initial={{ opacity: 0, y: 20 }}
            animate={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.6 }}
            className={`text-5xl md:text-7xl font-bold font-orbitron tracking-tight ${cyberpunkStyles.textGradient} mb-6`}
            style={{ textShadow: '0 0 10px rgba(34, 211, 238, 0.5)' }}
          >
            Artxtic AI
          </motion.h1>
          <motion.p 
            initial={{ opacity: 0, y: 20 }}
            animate={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.6, delay: 0.1 }}
            className="text-xl md:text-2xl text-cyan-200 mb-8 max-w-3xl mx-auto font-roboto"
          >
            AI-Powered Artistic Content Generation Platform
          </motion.p>
          <motion.div 
            initial={{ opacity: 0, y: 20 }}
            animate={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.6, delay: 0.2 }}
            className="flex flex-wrap justify-center gap-4"
          >
            <a 
              href="#overview" 
              className="px-8 py-3 bg-cyan-600 hover:bg-cyan-500 text-white rounded-full font-medium transition-colors"
            >
              View Case Study
            </a>
            <a 
              href="https://artxtic-ai.vercel.app/" 
              target="_blank" 
              rel="noopener noreferrer"
              className="px-8 py-3 border-2 border-cyan-400 text-cyan-400 hover:bg-cyan-400/10 rounded-full font-medium transition-colors"
            >
              Live Demo
            </a>
          </motion.div>
        </div>
        <div className="absolute inset-0 overflow-hidden opacity-20">
          <div className="absolute inset-0 bg-grid-cyan-400/[0.05] [mask-image:linear-gradient(0deg,transparent,black)]"></div>
        </div>
      </section>

      {/* Overview Section */}
      <section id="overview" className="py-20 bg-gray-900">
        <div className="container mx-auto px-4">
          <motion.div 
            initial={{ opacity: 0, y: 30 }}
            whileInView={{ opacity: 1, y: 0 }}
            viewport={{ once: true }}
            transition={{ duration: 0.6 }}
            className="max-w-4xl mx-auto"
          >
            <h2 className="text-3xl md:text-4xl font-bold mb-6 text-cyan-400 font-orbitron tracking-tight">Project Overview</h2>
            <div className="space-y-6 text-gray-300 font-sans">
              <p>
                Artxtic AI is a cutting-edge platform that leverages artificial intelligence to transform text prompts into stunning visual art. 
                Designed for artists, designers, and content creators, it provides an intuitive interface for generating unique digital artwork 
                with the power of AI.
              </p>
              <p>
                The application combines advanced machine learning models with a user-friendly interface, allowing users to explore their creativity 
                without the need for advanced technical skills or expensive software.
              </p>
            </div>
          </motion.div>

          {/* Screenshot Grid */}
          <motion.div 
            className="mt-16 grid grid-cols-1 md:grid-cols-2 gap-8"
            initial={{ opacity: 0, y: 30 }}
            whileInView={{ opacity: 1, y: 0 }}
            viewport={{ once: true }}
            transition={{ duration: 0.6, delay: 0.2 }}
          >
            {[
              { 
                title: "AI Art Generation Interface", 
                desc: "Clean, intuitive interface for generating AI artwork" 
              },
              { 
                title: "Style Selection", 
                desc: "Multiple artistic styles to choose from" 
              },
              { 
                title: "Prompt Engineering", 
                desc: "Smart suggestions for better AI art generation" 
              },
              { 
                title: "Gallery View", 
                desc: "Browse and manage your generated artwork" 
              },
            ].map((item, index) => (
              <div 
                key={index}
                className="bg-gray-800/50 rounded-xl overflow-hidden border border-gray-700/50 hover:border-cyan-400/50 transition-all duration-300 hover:shadow-lg hover:shadow-cyan-400/10"
              >
                <div className="h-48 bg-gradient-to-br from-purple-900/30 to-cyan-900/30 flex items-center justify-center">
                  <span className="text-gray-500">{item.title} Screenshot</span>
                </div>
                <div className="p-6">
                  <h3 className="text-xl font-semibold text-cyan-300 mb-2 font-orbitron tracking-tight">{item.title}</h3>
                  <p className="text-gray-400 font-sans">{item.desc}</p>
                </div>
              </div>
            ))}
          </motion.div>
        </div>
      </section>

      {/* Key Features */}
      <section className="py-20 bg-gray-900/50">
        <div className="container mx-auto px-4">
          <motion.div 
            className="text-center mb-16"
            initial={{ opacity: 0, y: 30 }}
            whileInView={{ opacity: 1, y: 0 }}
            viewport={{ once: true }}
            transition={{ duration: 0.6 }}
          >
            <h2 className="text-3xl md:text-4xl font-bold mb-4 text-cyan-400 font-orbitron tracking-tight">Key Features</h2>
            <p className="text-xl text-gray-400 max-w-3xl mx-auto">
              Innovative features that make Artxtic AI a powerful tool for digital artists
            </p>
          </motion.div>

          <div className="grid md:grid-cols-3 gap-8">
            {[
              {
                icon: (
                  <svg className="w-12 h-12 text-cyan-400" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                    <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={1.5} d="M9.75 3.104v5.714a2.25 2.25 0 01-.659 1.591L5.04 16.09a2.25 2.25 0 00-.51.85l-.822 2.558a2.25 2.25 0 001.788 2.827l2.558.822a2.25 2.25 0 00.85-.51l5.722-5.052a2.25 2.25 0 01.59-.342l5.15-1.75a2.25 2.25 0 001.426-2.2V4.94c0-.81-.525-1.524-1.307-1.778a10.01 10.01 0 00-9.208 1.04L9.75 3.104z" />
                    <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={1.5} d="M3 12h6m6 0h6m-6 6h6" />
                  </svg>
                ),
                title: "AI-Powered Generation",
                desc: "Generate unique artwork using advanced AI models trained on diverse artistic styles and techniques."
              },
              {
                icon: (
                  <svg className="w-12 h-12 text-purple-400" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                    <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={1.5} d="M9.53 16.122a3 3 0 00-5.78 1.128 2.25 2.25 0 01-2.4 2.245 4.5 4.5 0 008.4-2.245c0-.399-.078-.78-.22-1.128zm0 0a15.998 15.998 0 003.388-1.62m-5.043-.025a15.994 15.994 0 011.622-3.395m3.42 3.42a15.995 15.995 0 004.764-4.648l3.876-5.814a1.151 1.151 0 00-1.597-1.597L14.146 6.32a15.996 15.996 0 00-4.649 4.763m3.42 3.42a6.776 6.776 0 00-3.42-3.42" />
                  </svg>
                ),
                title: "Style Transfer",
                desc: "Apply different artistic styles to your generated images with a single click."
              },
              {
                icon: (
                  <svg className="w-12 h-12 text-pink-400" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                    <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={1.5} d="M3 16.5v2.25A2.25 2.25 0 005.25 21h13.5A2.25 2.25 0 0021 18.75V16.5m-13.5-9L12 3m0 0l4.5 4.5M12 3v13.5" />
                  </svg>
                ),
                title: "High-Resolution Export",
                desc: "Download your creations in high resolution, perfect for printing or digital display."
              }
            ].map((feature, index) => (
              <motion.div 
                key={index}
                className="bg-gray-800/50 p-8 rounded-xl border border-gray-700/50 hover:border-cyan-400/30 transition-all duration-300"
                initial={{ opacity: 0, y: 30 }}
                whileInView={{ opacity: 1, y: 0 }}
                viewport={{ once: true }}
                transition={{ duration: 0.5, delay: index * 0.1 }}
              >
                <div className="mb-6">
                  {feature.icon}
                </div>
                <h3 className="text-xl font-semibold text-white mb-3 font-orbitron tracking-tight">{feature.title}</h3>
                <p className="text-gray-400 font-sans">{feature.desc}</p>
              </motion.div>
            ))}
          </div>
        </div>
      </section>

      {/* Technology Stack */}
      <section className="py-20 bg-gray-900">
        <div className="container mx-auto px-4">
          <motion.div 
            className="text-center mb-16"
            initial={{ opacity: 0, y: 30 }}
            whileInView={{ opacity: 1, y: 0 }}
            viewport={{ once: true }}
            transition={{ duration: 0.6 }}
          >
            <h2 className="text-3xl md:text-4xl font-bold mb-4 text-cyan-400 font-orbitron tracking-tight">Technology Stack</h2>
            <p className="text-xl text-gray-400 max-w-3xl mx-auto">
              Built with modern technologies for optimal performance and user experience
            </p>
          </motion.div>

          <div className="grid grid-cols-2 md:grid-cols-4 gap-8 max-w-4xl mx-auto">
            {[
              { name: "React", icon: "react" },
              { name: "Node.js", icon: "node" },
              { name: "TensorFlow.js", icon: "tensorflow" },
              { name: "MongoDB", icon: "mongodb" },
              { name: "Express", icon: "express" },
              { name: "Tailwind CSS", icon: "tailwind" },
              { name: "Firebase", icon: "firebase" },
              { name: "Three.js", icon: "threejs" }
            ].map((tech, index) => (
              <motion.div 
                key={index}
                className="flex flex-col items-center"
                initial={{ opacity: 0, scale: 0.9 }}
                whileInView={{ opacity: 1, scale: 1 }}
                viewport={{ once: true }}
                transition={{ duration: 0.3, delay: index * 0.05 }}
              >
                <div className="w-20 h-20 bg-gray-800 rounded-xl flex items-center justify-center mb-3 border border-gray-700/50 hover:border-cyan-400/50 transition-colors">
                  <span className="text-3xl">{tech.icon}</span>
                </div>
                <span className="text-gray-300 font-medium font-sans">{tech.name}</span>
              </motion.div>
            ))}
          </div>
        </div>
      </section>

      {/* Impact & Results */}
      <section className="py-20 bg-gradient-to-br from-gray-900 to-gray-800">
        <div className="container mx-auto px-4">
          <motion.div 
            className="text-center mb-16"
            initial={{ opacity: 0, y: 30 }}
            whileInView={{ opacity: 1, y: 0 }}
            viewport={{ once: true }}
            transition={{ duration: 0.6 }}
          >
            <h2 className="text-3xl md:text-4xl font-bold mb-4 text-cyan-400 font-orbitron tracking-tight">Impact & Results</h2>
            <p className="text-xl text-gray-300 max-w-3xl mx-auto font-sans">
              The success metrics and impact of Artxtic AI
            </p>
          </motion.div>

          <div className="grid md:grid-cols-3 gap-8 max-w-5xl mx-auto">
            {[
              { value: "10K+", label: "Artworks Generated", desc: "By users worldwide" },
              { value: "4.8/5", label: "User Rating", desc: "Average rating from 500+ reviews" },
              { value: "95%", label: "Uptime", desc: "Reliable service with minimal downtime" }
            ].map((stat, index) => (
              <motion.div 
                key={index}
                className="bg-gray-800/30 backdrop-blur-sm p-8 rounded-xl border border-gray-700/50 text-center"
                initial={{ opacity: 0, y: 30 }}
                whileInView={{ opacity: 1, y: 0 }}
                viewport={{ once: true }}
                transition={{ duration: 0.5, delay: index * 0.1 }}
              >
                <div className="text-5xl font-bold text-cyan-400 mb-2">{stat.value}</div>
                <h3 className="text-xl font-semibold text-white mb-2 font-orbitron tracking-tight">{stat.label}</h3>
                <p className="text-gray-400 font-sans">{stat.desc}</p>
              </motion.div>
            ))}
          </div>
        </div>
      </section>

      {/* CTA Section */}
      <section className="py-20 bg-gray-900">
        <div className="container mx-auto px-4 text-center">
          <motion.div 
            className="max-w-3xl mx-auto"
            initial={{ opacity: 0, y: 30 }}
            whileInView={{ opacity: 1, y: 0 }}
            viewport={{ once: true }}
            transition={{ duration: 0.6 }}
          >
            <h2 className="text-3xl md:text-4xl font-bold mb-6 text-cyan-400 font-orbitron tracking-tight">Ready to Create Something Amazing?</h2>
            <p className="text-xl text-gray-300 mb-8 font-sans">
              Experience the power of AI in your creative process. Generate unique artwork with just a few clicks.
            </p>
            <div className="flex flex-wrap justify-center gap-4">
              <a 
                href="https://artxtic-ai.vercel.app/" 
                target="_blank" 
                rel="noopener noreferrer"
                className="px-8 py-4 bg-gradient-to-r from-cyan-500 to-purple-600 text-white rounded-full font-medium hover:opacity-90 transition-opacity"
              >
                Try Artxtic AI Now
              </a>
              <button 
                onClick={handleBackToExperience}
                className="px-8 py-4 border-2 border-cyan-400 text-cyan-400 hover:bg-cyan-400/10 rounded-full font-medium transition-colors"
              >
                Back to Portfolio
              </button>
            </div>
          </motion.div>
        </div>
      </section>
    </div>
  );
};

export default ArtxticCaseStudy;
